import { Component, OnInit } from '@angular/core';
import { AboutModel } from '../../models/about.model';
import { HttpPostService } from '../../services/httpPost.service';

declare var $:any;

@Component({
  selector: 'app-about-page',
  templateUrl: './about-page.component.html',
  styleUrls: ['./about-page.component.css']
}) 
export class AboutPageComponent implements OnInit {

  faculties = [{"facultyImage":"data:image/jpeg;base64,","facultyName":"Akash","facultyDescription":"Best Dancer on earth."}];
  
  aboutUs: AboutModel;

  loading: boolean = true;

  constructor(private httpPostService: HttpPostService) { }

  ngOnInit() {
    const data = { api : "getAbout", data : {}}
    this.httpPostService.httpPost(data).subscribe((val) => {
      this.aboutUs = val;
    },
    (error) => {
    });
    document.body.classList.add('bg-about');
  }
  ngOnDestroy(){
    document.body.classList.remove('bg-about');
  }
}